create table customers (
	id INT(11) NOT NULL AUTO_INCREMENT,
	uuid VARCHAR(40),
	customer_name VARCHAR(50),
	primary_phone VARCHAR(50),
	fax VARCHAR(50),
	secondary_phone VARCHAR(50),
	website VARCHAR(1000),
	email VARCHAR(250),
	notes TEXT,
	billing_address_one VARCHAR(50),
	billing_address_two VARCHAR(50),
	billing_address_city VARCHAR(50),
	billing_address_state VARCHAR(50),
	billing_address_zip VARCHAR(50),
	billing_address_country VARCHAR(50),
	shipping_address_one VARCHAR(50),
	shipping_address_two VARCHAR(50),
	shipping_address_city VARCHAR(50),
	shipping_address_state VARCHAR(50),
	shipping_address_zip VARCHAR(50),
	shipping_address_country VARCHAR(50),
	added_by VARCHAR(50),
	updated_by VARCHAR(50),
	added_on DATE,
	updated_on DATE,
	status VARCHAR(8),
	PRIMARY KEY (id) USING BTREE
);
